}

pub fn get_contract_instance_deployer_avm(address: AztecAddress) -> Option<AztecAddress> {
    let (member, exists) = get_contract_instance_deployer_internal_avm(address);
    if exists {
        Option::some(AztecAddress::from_field(member))
    } else {
