global PARTIAL_ADDRESS_LENGTH: u32 = 1;

// Partial address
pub struct PartialAddress {
    pub inner: Field,
}

impl ToField for PartialAddress {
    fn to_field(self) -> Field {
        self.inner
    }
}

impl Serialize<PARTIAL_ADDRESS_LENGTH> for PartialAddress {
